import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import Food2Guide from './Food2Guide';
import MyRecipes from './MyRecipes';

function App() {
  return (
    <div>
      <nav className="bg-white shadow-md">
        <div className="container mx-auto px-6 py-3 flex justify-between items-center">
          <Link to="/" className="text-xl font-semibold text-gray-700">Clip2Cook</Link>
          <div>
            <Link to="/my-recipes" className="text-gray-700 mx-3">My Recipes</Link>
            {/* Other nav links here */}
          </div>
        </div>
      </nav>

      <Routes>
        <Route path="/" element={<Food2Guide />} />
        <Route path="/my-recipes" element={<MyRecipes />} />
      </Routes>
    </div>
  );
}

export default App;
